public class DashboardFactory(string resourceName = null, Action<Humidifier.QuickSight.Dashboard> factoryAction = null) : ResourceFactory<Humidifier.QuickSight.Dashboard>(resourceName)
{

    internal List<InnerDashboardResourcePermissionFactory> PermissionsFactories { get; set; } = [];

    internal InnerDashboardParametersFactory ParametersFactory { get; set; }

    internal InnerDashboardDashboardSourceEntityFactory SourceEntityFactory { get; set; }

    internal InnerDashboardDashboardVersionDefinitionFactory DefinitionFactory { get; set; }

    internal InnerDashboardValidationStrategyFactory ValidationStrategyFactory { get; set; }

    internal InnerDashboardLinkSharingConfigurationFactory LinkSharingConfigurationFactory { get; set; }

    internal InnerDashboardDashboardPublishOptionsFactory DashboardPublishOptionsFactory { get; set; }

    protected override Humidifier.QuickSight.Dashboard Create()
    {
        var dashboardResult = CreateDashboard();
        factoryAction?.Invoke(dashboardResult);

        return dashboardResult;
    }

    private Humidifier.QuickSight.Dashboard CreateDashboard()
    {
        var dashboardResult = new Humidifier.QuickSight.Dashboard
        {
            GivenName = InputResourceName,
        };

        return dashboardResult;
    }
    public override void CreateChildren(Humidifier.QuickSight.Dashboard result)
    {
        base.CreateChildren(result);

        result.Permissions = PermissionsFactories.Any() ? PermissionsFactories.Select(x => x.Build()).ToList() : null;
        result.Parameters ??= ParametersFactory?.Build();
        result.SourceEntity ??= SourceEntityFactory?.Build();
        result.Definition ??= DefinitionFactory?.Build();
        result.ValidationStrategy ??= ValidationStrategyFactory?.Build();
        result.LinkSharingConfiguration ??= LinkSharingConfigurationFactory?.Build();
        result.DashboardPublishOptions ??= DashboardPublishOptionsFactory?.Build();
    }

} // End Of Class

